const Card = ()=>{
    return (
        <div >
           {/* <button className={style.closebutoon} 
              onClick={()=>onClose(id)}>   X
           </button> */}
  
           <img  src={image} alt="" />
           <Link to={`/detail/${id}`}><h2>Name: {name}</h2></Link>
           <h2>Specie: {species}</h2>
           <h2>Gender: {gender}</h2>
           <hr />
        </div>
     );

}

export default Card;
